-- ----------------------------
-- Table structure for account
-- ----------------------------
DROP TABLE IF EXISTS `account`;
CREATE TABLE `account`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '帐号标识符(唯一)',
  `username` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '名称',
  `gmlevel` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT '管理员等级',
  `password` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '密码',
  `channel` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '渠道',
  `accgold` int(11) NOT NULL DEFAULT 0 COMMENT '帐号金币',
  `accgoldadd` int(11) NOT NULL DEFAULT 0 COMMENT '帐号金币充值',
  `email` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '邮箱',
  `last_ip` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '0.0.0.0' COMMENT '登录IP',
  `joindate` timestamp NOT NULL DEFAULT '1970-01-02 00:00:00' COMMENT '创建日期',
  `last_login` timestamp NOT NULL DEFAULT '1970-01-02 00:00:00' COMMENT '离线日期',
  `locked` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否禁用',
  `cardname` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL,
  `cardid` varchar(18) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL,
  `phone` varchar(15) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL,
  `quiz1` varchar(18) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL,
  `answer1` varchar(18) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL,
  `quiz2` varchar(18) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL,
  `answer2` varchar(18) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL,
  `birthday` varchar(18) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL,
  `mobilephone` varchar(18) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL,
  `error_count` int(11) UNSIGNED NOT NULL DEFAULT 0,
  `action_tick` bigint(20) UNSIGNED NOT NULL DEFAULT 0,
  `SecCode` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '安全码',
  PRIMARY KEY (`id`, `username`) USING BTREE,
  INDEX `idx_account`(`username`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 10 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin ROW_FORMAT = DYNAMIC;

