  `AddPoint` text CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL,
  `RTname` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '掉落者名称',
  `Killidx` int(10) NOT NULL DEFAULT 0 COMMENT '符文值',
