  `GemItemID` text CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '宝石id',
  `RareAttr` text CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '稀有属性',
  `GodAttr` text CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '神器属性',
  `UserAttr` text CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '自定义属性',
  `ExtraInfo` text CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '额外信息',
  `MagUpID` int(10) UNSIGNED NULL DEFAULT 0 COMMENT '技能强化id',
  `nShape` int(10) UNSIGNED NULL DEFAULT 0 COMMENT '自定义Shape',
  `nAniCount` int(10) UNSIGNED NULL DEFAULT 0 COMMENT '自定义AniCount',
  `nLooks` int(10) UNSIGNED NULL DEFAULT 0 COMMENT '自定义Looks',
  `nInLooks` int(10) UNSIGNED NULL DEFAULT 0 COMMENT '自定义InLooks',
  `nInLooksType` int(10) UNSIGNED NULL DEFAULT 0 COMMENT '自定义InLooksType',
  `nInLooksNum` int(10) UNSIGNED NULL DEFAULT 0 COMMENT '自定义InLooksNum',
  `Binded` int(10) UNSIGNED NULL DEFAULT 0 COMMENT '物品绑定',
  `LimitType` int(10) UNSIGNED NULL DEFAULT 0 COMMENT '物品限时类型',
  `LimitTime` int(10) UNSIGNED NULL DEFAULT 0 COMMENT '物品过期时间戳',
  INDEX `idx_owner_guid`(`owner_guid`) USING BTREE
) ENGINE = MyISAM CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = '背包和 装备 物品' ROW_FORMAT = DYNAMIC;

